import React from "react";
import Content from "./Content";
class ChoiceSection extends React.Component {
  render() {
    return (
      <section className="choice">
        <h1 className="choice__title">MagicTap</h1>
        <section className="choice__menu">
          <h2 className="choice__menu__title">Menu</h2>
          <ul className="choice__menu__container">
            <li className="choice__menu__item">Overview</li>
            <li className="choice__menu__item">Company Benefits</li>
            <li className="choice__menu__item">Employees</li>
            <li className="choice__menu__item">
              <a href="">My profile</a>
            </li>
          </ul>
        </section>
        <section className="main-content">
          <Content />
        </section>
      </section>
    );
  }
}

export default ChoiceSection;
